I'm glad to hear that you're interested in compiler optimization! Here are a few popular techniques along with simple examples to illustrate how they work:

1. **Constant Folding**: This technique involves evaluating constant expressions at compile time instead of runtime. It helps to reduce the number of instructions executed at runtime.

   *Before optimization:*
   ```c
   int add(int a, int b) {
       return a + b;
   }
   int result = add(2, 3);
   ```

   *After constant folding:*
   ```c
   int result = 5;
   ```

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are not used. This helps to reduce the size of the generated code and improve performance.

   *Before optimization:*
   ```c
   int foo(int a) {
       int b = a * 2;
       int c = b + 1;
       return c;
   }
   int result = foo(5);
   ```

   *After DCE:*
   ```c
   int result = foo(5);
   ```

